<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    let a = [7, 2, 5, 3, 5, 3];
    let b = [7, 2, 5, 4, 6, 3, 5, 3];
    let c = [];
    let count;
    for (let i = 0; i < b.length; i++) {
        count = 0;
        for (let j = 0; j < a.length; j++) {
            if (b[i] === a[j]) {
                count++;
            }
        }
        if (count === 0) {
            c.push(b[i]);
        }
    }
    document.write(c);
</script>
</body>
</html>
